    name: SECTION 6.6.3
    sectionNumber: 6.6.3
    sectionTitle: Blinding and Unblinding
    text: "<div><p>The study will be double-blind. To further preserve the blinding\
      \ of the study, only a minimum number of Lilly and CRO personnel will see the\
      \ randomization table and codes before the study is complete.</p>\n<p>Emergency\
      \ codes generated by a computer drug-labeling system will be available to the\
      \ investigator. These codes, which reveal the patients treatment group, may\
      \ be opened during the study only if the choice of follow-up treatment depends\
      \ on the patient\u2019s therapy assignment.</p>\n<p>The investigator should\
      \ make every effort to contact the clinical research physician prior to unblinding\
      \ a patient\u2019s therapy assignment. If a patient\u2019s therapy assignment\
      \ is unblinded, Lilly must be notified immediately by telephone. After the study,\
      \ the investigator must return all sealed and any opened codes.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001335
